INSERT INTO `menu_custom` (`menu_name`, `title`, `description`) VALUES
('navigation', 'Navigace', 'Navigační menu je poskytováno samotným Drupalem a je hlavním interaktivním menu pro každý web. Je to většinou jediné menu, které obsahuje individuální odkazy pro přihlášené uživatele, a většinou se vůbec nezobrazuje anonymním uživatelům.'),
('primary-links', 'Primární odkazy', 'Primární odkazy se používají jako navigace pro hlavní sekce webu a jsou obvykle umístěny v horní části webu v podobě záložek.'),
('secondary-links', 'Sekundární odkazy', 'Sekundární odkazy jsou často používány pro doplňkové menu se stránkami jako jsou kontakty, copyright nebo doplňková navigace, která nehraje tak velkou roli jako primární odkazy.');
