INSERT INTO `node_type` (`type`, `name`, `module`, `description`, `help`, `has_title`, `title_label`, `has_body`, `body_label`, `min_word_count`, `custom`, `modified`, `locked`, `orig_type`) VALUES
('page', 'Stránka', 'node', '<em>Stránka</em> je jednoduchá metoda vytváření a zobrazování informací, které se zřídka mění, jako sekce webu „O nás“. Ve výchozím nastavení <em>stránka</em> neumožňuje návštěvníkům psát komentáře a neobjevuje se na úvodní stránce webu.', '', 1, 'Nadpis', 1, 'Text', 0, 1, 1, 0, 'page'),
('story', 'Článek', 'node', '<em>Článek</em> má podobnou formu jako <em>stránka</em>. Je vhodný pro vytváření a zobrazování obsahu, který informuje nebo upoutává návštěvníky webu. Tiskové zprávy, oznámení a neformální příspěvky podobné blogu, to vše umožňuje typ obsahu <em>článek</em>. Ve výchozím nastavení se <em>článek</em> objevuje na úvodní stránce webu a umožňuje psaní komentářů.', '', 1, 'Nadpis', 1, 'Text', 0, 1, 1, 0, 'story'),
('poll', 'Anketa', 'poll', '<em>Anketa</em> je otázka se souborem možných odpovědí. Po vytvoření <em>ankety</em> se automaticky průběžně počítá počet hlasů obdržených pro jednotlivé odpovědi.', '', 1, 'Otázka', 0, '', 0, 0, 1, 1, 'poll'),
('forum', 'Příspěvek do diskuse', 'forum', '<em>Téma fóra</em> je první příspěvek do nové diskuse ve fóru.', '', 1, 'Předmět', 1, 'Text', 0, 0, 1, 1, 'forum'),
('events', 'Události', 'node', '', '', 1, 'Nadpis', 1, 'Text', 0, 1, 1, 0, ''),
('feed', 'Zdroj', 'node', 'Subscribe to RSS or Atom feeds. Creates nodes of the content type "Feed item" from feed content.', '', 1, 'Nadpis', 1, 'Text', 0, 0, 0, 1, 'feed'),
('feed_item', 'Feed item', 'node', 'This content type is being used for automatically aggregated content from feeds.', '', 1, 'Nadpis', 1, 'Text', 0, 0, 0, 1, 'feed_item'),
('project', 'Projekt', 'node', '', '', 1, 'Nadpis', 1, 'Text', 0, 1, 1, 0, ''),
('profile', 'Profil', 'node', 'Uživatelské profily', '', 1, 'Nadpis', 1, 'Text', 0, 1, 1, 0, 'profile'),
('activitystream', 'Activity Stream Item', 'activitystream', 'A node type to contain items from your activity stream. You shouldn''t create these nodes directly.', 'A node type to contain items from your activity stream. You shouldn''t create these nodes directly.', 1, 'Nadpis', 1, 'Text', 0, 0, 0, 1, 'activitystream');
