('user_mail_register_admin_created_subject', 's:49:"Administrátor pro vás vytvořil účet na !site";'),
('user_mail_register_admin_created_body', 's:598:"Zpráva pro uživatele jménem !username:\r\n\r\nAdministrátor webu !site pro vás vytvořil účet. Nyní se můžete přihlásit na adrese !login_uri s použitím následujícího uživatelského jména a hesla:\r\n\r\nuživatelské jméno: !username\r\nheslo: !password\r\n\r\nTaké se můžete přihlásit kliknutím na tento odkaz (můžete jej rovněž zkopírovat do svého prohlížeče):\r\n\r\n!login_url\r\n\r\nToto je jednorázové přihlášení, takže jej lze použít pouze jednou.\r\n\r\nPo přihlášení budete přesměrován na adresu !edit_uri, kde si můžete změnit heslo.\r\n\r\n\r\n-- Autoři webu !site";'),
('user_mail_register_no_approval_required_subject', 's:37:"Podrobnosti účtu !username na !site";'),
('user_mail_register_no_approval_required_body', 's:591:"Zpráva pro uživatele jménem !username:\r\n\r\nDěkujeme vám za registraci na webu !site. Nyní se můžete přihlásit na adrese !login_uri s použitím následujícího uživatelského jména a hesla:\r\n\r\nuživatelské jméno: !username\r\nheslo: !password\r\n\r\nTaké se můžete přihlásit kliknutím na tento odkaz (můžete jej rovněž zkopírovat do svého prohlížeče):\r\n\r\n!login_url\r\n\r\nToto je jednorázové přihlášení, takže jej lze použít pouze jednou.\r\n\r\nPo přihlášení budete přesměrován/a na adresu !edit_uri, kde si můžete změnit heslo.\r\n\r\n\r\n-- Autoři webu !site";'),
('user_mail_register_pending_approval_subject', 's:61:"Podrobnosti účtu !username na !site (čeká na schválení)";'),
('user_mail_register_pending_approval_body', 's:316:"Zpráva pro uživatele jménem !username:\r\n\r\nDěkujeme za Vaši žádost o účet na webu !site. Vaše žádost nyní čeká na schválení administrátorem. Jakmile bude schválena, dostanete další e-mail s informacemi o možnosti přihlášení, nastavení hesla a dalších detailech.\r\n\r\n-- \r\nAutoři webu !site";'),
('user_mail_password_reset_subject', 's:54:"Nové přihlašovací informace pro !username na !site";'),
('user_mail_password_reset_body', 's:508:"Zpráva pro uživatele jménem !username:\r\n\r\nNa webu !site byl přijat požadavek na nastavení hesla k Vašemu účtu.\r\n\r\nNyní se můžete přihlásit k !uri_brief kliknutím na následující odkaz nebo jeho zkopírováním do Vašeho prohlížeče:\r\n\r\n!login_url\r\n\r\nToto je jednorázové přihlášení, takže může být použito pouze jednou. Jeho platnost je jeden den a pokud jej nepoužijete, nic se nestane.\r\n\r\nPo přihlášení budete přesměrován/a na !edit_uri, kde si můžete změnit heslo.";'),
('user_mail_status_activated_notify', 'i:1;'),
('user_mail_status_activated_subject', 's:71:"Podrobnosti uživatelského účtu !username na webu !site (schváleno)";'),
('user_mail_status_activated_body', 's:480:"Zpráva pro uživatele jménem !username:\r\n\r\nVáš účet na webu !site byl aktivován.\r\n\r\nNyní se můžete přihlásit k !uri_brief kliknutím na následující odkaz nebo jeho zkopírováním do Vašeho prohlížeče:\r\n\r\n!login_url\r\n\r\nToto je jednorázové přihlášení, takže může být použito pouze jednou. Jeho platnost je jeden den a pokud jej nepoužijete, nic se nestane.\r\n\r\nPo přihlášení budete přesměrován/a na !edit_uri kde si budete moci změnit heslo.\r\n";'),
('user_mail_status_blocked_notify', 'i:0;'),
